import React from "react";
import { NavLink } from "react-router-dom";
import {
  Button,
  Dropdown,
  Image,
  Menu,
  Input,
  Icon,
  Segment,
  Divider,
  Container,
} from "semantic-ui-react";

function Navbar() {
return (
  <div>
    <Menu inverted fixed="top">
    <Container>
      <Menu inverted size="large" >
        <Menu.Item>
          <Image
            as={NavLink}
            to="/home"
            src="images/naxus12.PNG"
            size="small"
          />
        </Menu.Item>

        <Menu.Menu position="right">
          <Menu.Item className="d-flex justify-content-end">
            <Input
              size="huge"
              className="icon"
              icon="search"
              placeholder="Searching?"
            />
          </Menu.Item>
          <Menu.Item >
            <Icon name="user outline" size="large" />
            <Dropdown  item text="Account" >
              <Dropdown.Menu>
                <Dropdown.Item>
                  <Button primary size="small" as={NavLink} to="/loginscreen">
                    Login
                    <Icon name="sign in" />
                  </Button>
                </Dropdown.Item>
                <Dropdown.Item>
                  <Button primary size="small" as={NavLink} to="/signup">
                    Sign-up <Icon name="signup" />
                  </Button>
                </Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
          </Menu.Item>
          <Menu.Item>
            <Button
              backgroundcolor="grey"
              inverted
              color="black"
              as={NavLink}
              to="/myfavorites"
            >
              <Icon name="heart outline" />
              My Favorite
            </Button>
          </Menu.Item>
          <Menu.Item>
            <Button
              backgroundcolor="grey"
              inverted
              color="black"
              as={NavLink}
              to="/cart"
            >
              <Icon name="shopping cart" />
              Cart
            </Button>
          </Menu.Item>
        </Menu.Menu>
      </Menu>
    </Container>
    </Menu>
  </div>
);

}
export default Navbar;







